	(201, 19, '2022-10-11 20:32:07', '2022-10-11 20:32:09', 'Let\'s Build a Multi-Purpose Laravel + Vue Application', 'PLB4AdipoHpxaHDLIaMdtro1eXnQtl_UvE', 'Let\'s Build a Multi-Purpose Laravel + Vue Application is out now. In this series, you learn everything you need to know about Building a complete web application with Laravel and Vue js. So, I am so excited that so many of you guys like my content and keep inspiring me to create more videos. My goals is to inspire you to write better code and better applications. \n\nOpen Source At Github.\nhttps://github.com/Hujjat/laravStart\n\nHere are the things you will learn in this series:\n\n* How use Vue Router with Laravel\n* How to Install AdminLTE 3\n* How to Use Font Awesome 5 on Laravel\n* How integrate mailchimp with laravel\n* How to use Laravel Socialite\n* How to Login Using Social Media\n* How to Use API in Laravel\n* Api Auth with Laravel Passport\n* JWT with Laravel Passport and JavaScript Request\n* Vue Custom Events\n* Vue form with Laravel\n* Relational Database with Laravel\n* Axios and Ajax Request\n* ACL in Laravel\n* Online Users list\n* And much more...\n\n\nTags:\n\nJWT with Laravel,tutorial,coding,laravel,laravel and vue js tutorial,laravel and vuejs,laravel and vue js project,laravel admin panel,laravel adminlte,laravel admin,vue js tutorial,vue js,axios,laravel application development,learn laravel 5.6,learn laravel framework,learn laravel,laravel crud,laravel crud tutorial,spa,laravel how to,how to laravel,laravel course,laravel tips,coding tips,admin lte laravel 5.6,adminlte with php,laravel api,laravel passport', 'https://i.ytimg.com/vi/wM4L_yDGqpo/default.jpg', '2018-08-16 01:13:18', '', 'youtube#playlist', 54),
