	(65, 65, '2022-08-14 22:11:48', '2022-08-14 22:11:48', 'zQdBSpTDQpQ', 'Curso Laravel - Conexão ao banco de dados MySQL - #10', 'Neste vídeo vamos criar a conexão ao banco de dados #MySQL com o #Laravel, uma parte fundamental de todo sistema web para poder realizar o #CRUD (Create, Read, Update e Delete), que são as operações básicas que realizamos em DBs.\n------------------------------\nLinks importantes:\n\n★ Nossos Cursos: https://horadecodar.com.br/cursos-horadecodar/\n★ eBook JavaScript Avançado: https://www.horadecodar.com.br/ebook-javascript-avancado-gratuito/\n★ Repositório: https://github.com/matheusbattisti/curso_laravel\n★ Dev bit a bit: https://www.horadecodar.com.br/dev-bit-a-bit-se-torne-um-programador/', '00:00:00', 'zQdBSpTDQpQ', 'video/youtube', 'https://i.ytimg.com/vi/zQdBSpTDQpQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCDoFiMhpOnLFq1uG4RL4xag', '2020-10-21 11:24:27'),
