	(68, 68, '2022-08-14 22:11:48', '2022-08-14 22:11:48', 'Q0GYYxgdWno', 'Curso Laravel - Utilizando o Eloquent do Laravel - #13', 'Nesta aula vamos aprender o #Eloquent a #ORM que o #Laravel utiliza, com este recurso vamos conseguir fazer interações com o banco de dados de forma mais simples, ou seja, o famoso CRUD.\n------------------------------\nLinks importantes:\n\n★ Nossos Cursos: https://horadecodar.com.br/cursos-horadecodar/\n★ eBook JavaScript Avançado: https://www.horadecodar.com.br/ebook-javascript-avancado-gratuito/\n★ Repositório: https://github.com/matheusbattisti/curso_laravel\n★ Dev bit a bit: https://www.horadecodar.com.br/dev-bit-a-bit-se-torne-um-programador/', '00:00:00', 'Q0GYYxgdWno', 'video/youtube', 'https://i.ytimg.com/vi/Q0GYYxgdWno/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCDoFiMhpOnLFq1uG4RL4xag', '2020-11-02 11:21:14'),
