	(70, 70, '2022-08-14 22:11:48', '2022-08-14 22:11:48', 'z1ISAp7sYwo', 'Curso Laravel - Salvando dados no banco MySQL - #15', 'Nesta aula vamos aprender a como salvar dados no banco com #Laravel, vamos utilizar o banco de dados #MySQL e o #Eloquent, como ORM. Desta maneira aprenderemos a primeira parte do CRUD, o create.\n\n------------------------------\nLinks importantes:\n\n★ Nossos Cursos: https://horadecodar.com.br/cursos-horadecodar/\n★ eBook JavaScript Avançado: https://www.horadecodar.com.br/ebook-javascript-avancado-gratuito/\n★ Repositório: https://github.com/matheusbattisti/curso_laravel\n★ Dev bit a bit: https://www.horadecodar.com.br/dev-bit-a-bit-se-torne-um-programador/', '00:00:00', 'z1ISAp7sYwo', 'video/youtube', 'https://i.ytimg.com/vi/z1ISAp7sYwo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCDoFiMhpOnLFq1uG4RL4xag', '2020-11-09 12:29:56'),
