	(72, 72, '2022-08-14 22:11:48', '2022-08-14 22:11:48', '5J8ammjVcCo', 'Curso Laravel - Upload de imagens com Laravel - #17', 'Nesta aula vamos aprender a realizar o upload de imagens com o framework #Laravel, para que possamos resgatar no nosso #front-end posteriormente. Utilizaremos a técnica de salvar a imagem no servidor e caminho da mesma no #MySQL\n\n\n------------------------------\nLinks importantes:\n\n★ Nossos Cursos: https://horadecodar.com.br/cursos-horadecodar/\n★ eBook JavaScript Avançado: https://www.horadecodar.com.br/ebook-javascript-avancado-gratuito/\n★ Repositório: https://github.com/matheusbattisti/curso_laravel\n★ Dev bit a bit: https://www.horadecodar.com.br/dev-bit-a-bit-se-torne-um-programador/', '00:00:00', '5J8ammjVcCo', 'video/youtube', 'https://i.ytimg.com/vi/5J8ammjVcCo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCDoFiMhpOnLFq1uG4RL4xag', '2020-11-16 12:17:48'),
	(73, 73, '2022-08-14 22:11:48', '2022-08-14 22:11:48', 'UF3bUQAIXu4', 'Curso Laravel - Resgatando um registro do banco de dados - #18', 'Nesta aula vamos aprender a resgatar dados do banco #MySQL com #Laravel, utilizando a sua #ORM Eloquent para nos ajudar na tarefa. Esta é outra etapa muito importante do CRUD, que é o R de read.\n\n------------------------------\nLinks importantes:\n\n★ Nossos Cursos: https://horadecodar.com.br/cursos-horadecodar/\n★ eBook JavaScript Avançado: https://www.horadecodar.com.br/ebook-javascript-avancado-gratuito/\n★ Repositório: https://github.com/matheusbattisti/curso_laravel\n★ Dev bit a bit: https://www.horadecodar.com.br/dev-bit-a-bit-se-torne-um-programador/', '00:00:00', 'UF3bUQAIXu4', 'video/youtube', 'https://i.ytimg.com/vi/UF3bUQAIXu4/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCDoFiMhpOnLFq1uG4RL4xag', '2020-11-18 11:22:10'),
