	(75, 75, '2022-08-14 22:11:48', '2022-08-14 22:11:48', '7rrFP1LUhQI', 'Curso Laravel - Salvando datas no banco de dados - #20', 'Nesta aula vamos aprender a salvar datas no banco de dados com #Laravel,  este tipo de dado é muito utilizado para quando precisamos nos recordar de algum fato, exemplo: data de nascimento de uma pessoa, o Laravel possibilita facilmente salvar os dados no #MySQL\n\n------------------------------\nLinks importantes:\n\n★ Nossos Cursos: https://horadecodar.com.br/cursos-horadecodar/\n★ eBook JavaScript Avançado: https://www.horadecodar.com.br/ebook-javascript-avancado-gratuito/\n★ Repositório: https://github.com/matheusbattisti/curso_laravel\n★ Dev bit a bit: https://www.horadecodar.com.br/dev-bit-a-bit-se-torne-um-programador/', '00:00:00', '7rrFP1LUhQI', 'video/youtube', 'https://i.ytimg.com/vi/7rrFP1LUhQI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCDoFiMhpOnLFq1uG4RL4xag', '2020-11-26 01:39:20'),
