	(77, 77, '2022-08-14 22:11:48', '2022-08-14 22:11:48', 'xFi5lC4QRZQ', 'Curso Laravel - Autenticação no Laravel (login/registro) - #22', 'Nesta aula vamos começar a criar a funcionalidade de autenticação, ou seja, #login e registro no #Laravel, que tem uma solução muito interessante para isso, minimizando o código que precisamos para ter um sistema de autenticação completo e funcional.\n\n------------------------------\nLinks importantes:\n\n★ Nossos Cursos: https://horadecodar.com.br/cursos-horadecodar/\n★ eBook JavaScript Avançado: https://www.horadecodar.com.br/ebook-javascript-avancado-gratuito/\n★ Repositório: https://github.com/matheusbattisti/curso_laravel\n★ Dev bit a bit: https://www.horadecodar.com.br/dev-bit-a-bit-se-torne-um-programador/', '00:00:00', 'xFi5lC4QRZQ', 'video/youtube', 'https://i.ytimg.com/vi/xFi5lC4QRZQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCDoFiMhpOnLFq1uG4RL4xag', '2020-12-02 12:45:45'),
	(78, 78, '2022-08-14 22:11:48', '2022-08-14 22:11:48', 'BtOAqNYo9Pg', 'Curso Laravel - Relação One to Many - #23', 'Nesta aula vamos criar uma relação entre tabelas do banco de dados #MySQL, que é a one to many, quando um modelo pode ter vários itens e os itens podem ter apenas um modelo. Faremos isso utilizando #Laravel e também os recursos da ORM #Eloquent\n\n------------------------------\nLinks importantes:\n\n★ Nossos Cursos: https://horadecodar.com.br/cursos-horadecodar/\n★ eBook JavaScript Avançado: https://www.horadecodar.com.br/ebook-javascript-avancado-gratuito/\n★ Repositório: https://github.com/matheusbattisti/curso_laravel\n★ Dev bit a bit: https://www.horadecodar.com.br/dev-bit-a-bit-se-torne-um-programador/', '00:00:00', 'BtOAqNYo9Pg', 'video/youtube', 'https://i.ytimg.com/vi/BtOAqNYo9Pg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCDoFiMhpOnLFq1uG4RL4xag', '2020-12-07 02:03:45'),
