	(237, 237, '2022-08-15 15:08:25', '2022-08-15 15:08:25', 'MfOWQIDE0Uw', 'Impressora 3D caseira #10 - Configurando o Marlin', 'Chegou a hora de iniciar uma nova etapa no projeto da impressora 3D caseira, a configuração e calibração. Nesse vídeo vou mostrar as configurações iniciais que eu usei no meu projeto e explicar como calcular os steps de cada eixo da impressora.\nMais conteúdo no site http://hardware.rbtech.info/impressora-3d-caseira-configuracao-calibracao/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'MfOWQIDE0Uw', 'video/youtube', 'https://i.ytimg.com/vi/MfOWQIDE0Uw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCVEa_x1n5FwWrxH00MrDPzQ', '2018-08-02 09:16:22'),
	(238, 238, '2022-08-15 15:08:25', '2022-08-15 15:08:25', '_nBYw5JROwA', 'Impressora 3D caseira #11 - Calibração básica', 'Nesse vídeo vou mostrar a primeira etapa do processo de calibração da impressora 3D caseira, ou seja, como fazer a aferição das taxas de movimento de cada eixo e ajustar caso necessário.\nMais conteúdo no site http://hardware.rbtech.info/impressora-3d-caseira-configuracao-calibracao/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', '_nBYw5JROwA', 'video/youtube', 'https://i.ytimg.com/vi/_nBYw5JROwA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCVEa_x1n5FwWrxH00MrDPzQ', '2018-08-13 04:35:57'),
	(239, 239, '2022-08-15 15:08:25', '2022-08-15 15:08:25', '6OBLGEKCrvA', 'Impressora 3D caseira #12 - Imprimindo a primeira peça', 'Veja nesse vídeo com fazer a calibração da sua impressora 3d imprimindo um cubo de verificação para acertar sua máquina e deixá-la com a precisão ideal. Além de preparar a peça você vai aprender como nivelar a mesa para começar a imprimir.\nMais conteúdo no site http://hardware.rbtech.info/impressora-3d-caseira-configuracao-calibracao/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', '6OBLGEKCrvA', 'video/youtube', 'https://i.ytimg.com/vi/6OBLGEKCrvA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCVEa_x1n5FwWrxH00MrDPzQ', '2018-08-14 03:12:43'),
	(240, 240, '2022-08-15 15:08:25', '2022-08-15 15:08:25', 'n7dqQu8SewQ', 'Impressora 3D caseira #13 - Dúvidas comuns (FAQ)', 'Confira nesse vídeo as respostas para as principais dúvidas deixadas na série sobre a impressora 3D caseira.\n=== ÍNDICE DO CONTEÚDO ===\n4:01 O que fazer/estudar para ajudar na construção de uma impressora?\n5:21 Qual software usado na impressora? É livre? Multiplataforma?\n5:52 Tem um manual em PDF para seguir?\n6:14 Dá pra usar outros motores? Motores diferentes?\n6:59 Por que meus motores estão travando?\n8:00 Por que meu LCD não funciona?\n8:48 Dá pra fazer com área de impressão maior?\n9:35 Corrediças são precisas pra uma impressora 3D?\n10:53 Posso usar outro tipo de vidro na mesa aquecida?\n12:05 Quanta energia a impressora gasta?\n13:20 Preciso saber modelar 3D? Onde baixar peças pra imprimir?\n14:36 Demora pra imprimir uma peça?\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'n7dqQu8SewQ', 'video/youtube', 'https://i.ytimg.com/vi/n7dqQu8SewQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCVEa_x1n5FwWrxH00MrDPzQ', '2018-08-20 12:02:21'),
	(241, 241, '2022-08-15 15:08:25', '2022-08-15 15:08:25', 'AvRw_uOG0zg', 'Impressora 3D caseira #14 - Upgrades e modelagem', 'Links e conteúdo extra: http://hardware.rbtech.info/impressora-3d-caseira-upgrades-melhorias/\nConfira os upgrades/melhorias feitas na impressora 3D caseira e conheça também o Tinkercad, uma ferramenta básica de modelagem para criar suas primeiras peças autorais.\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'AvRw_uOG0zg', 'video/youtube', 'https://i.ytimg.com/vi/AvRw_uOG0zg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCVEa_x1n5FwWrxH00MrDPzQ', '2018-09-05 02:20:12'),
	(242, 242, '2022-08-15 15:08:29', '2022-08-15 15:08:29', '6nMOkPt8RzM', 'Impressora 3d caseira  - #1 Apresentação da Ramps 1.4 shield', '*Loja → https://shopee.com.br/kilovolt_\n*Instagram → https://www.instagram.com/autonomia_digital/\n\nFala ae galera, estou começando a montar a minha impressora 3D caseira, tomando como partida alguns tutoriais da internet e vou compartilhar com vocês como será feita a minha e passar como irei montar, peças e etc... \nNesse primeiro vídeo quero apenas passar para vocês um pequeno conhecimento sobre a ramps 1.4 que será nosso shield para controlar os motores sendo todo o sistema controlado pelo arduino mega 2560. \n\n*Lembrando que é meu primeiro contato com esse mundo', '00:00:00', '6nMOkPt8RzM', 'video/youtube', 'https://i.ytimg.com/vi/6nMOkPt8RzM/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCauRqwBtEMaJdQvgCNL6sbw', '2021-09-30 02:35:27'),
