	(249, 249, '2022-08-15 15:08:29', '2022-08-15 15:08:29', 'akQRAdY-X_Q', 'Impressora 3d caseira  - #10 Eletrônica e montagem final', '*Loja → https://shopee.com.br/kilovolt_\n*Instagram → https://www.instagram.com/autonomia_digital/\n\nFala pessoal esse é o ultimo vídeo relacionado a montagem da maquina, agora todas as ligações e toda a parte mecânica já está montada faltando apenas realizar as 2 etapas de calibração, a calibração manual e a calibração feita com o cubo de impressão que será explicado no próximo vídeo.', '00:00:00', 'akQRAdY-X_Q', 'video/youtube', 'https://i.ytimg.com/vi/akQRAdY-X_Q/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCauRqwBtEMaJdQvgCNL6sbw', '2021-12-31 03:37:20'),
