	(251, 251, '2022-08-15 15:08:29', '2022-08-15 15:08:29', 'VcNFcam-cEc', 'Impressora 3d caseira  - #12 Calibração e Offset', '*Loja → https://shopee.com.br/kilovolt_\n*Instagram → https://www.instagram.com/autonomia_digital/\n\nFala pessoal, nesse vídeo eu explico o passo a passo de como medir, calcular e corrigir os passos da impressora 3d para realizar a primeira impressão do cubo de calibração, explico também como ajustar o Z Offset para quem que assim como eu possui nivelamento automático 3d touch.\n\nCubo de calibração: https://www.thingiverse.com/thing:1278865', '00:00:00', 'VcNFcam-cEc', 'video/youtube', 'https://i.ytimg.com/vi/VcNFcam-cEc/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCauRqwBtEMaJdQvgCNL6sbw', '2022-01-23 05:59:09'),
