	(266, 266, '2022-08-15 15:08:37', '2022-08-15 15:08:37', 'HSGanQDC5qo', 'A Torre: Impressora 3D', 'A Torre é uma impressora 3D de baixo custo desenvolvida com o objetivo de ensinar sobre impressão 3D, eletrônica, programação e robótica. \n\nO projeto completo da estrutura da Torre está disponível gratuitamente no link:\nhttps://drive.google.com/file/d/1pr-9YyLiZpl4BMhAZhcARAgFLOwBTzUd/view?usp=sharing\n\nLista completa  de materiais: https://drive.google.com/open?id=1FuUTZSkXk4Ug4mzm9Mh7pcFYozLLJup_', '00:00:00', 'HSGanQDC5qo', 'video/youtube', 'https://i.ytimg.com/vi/HSGanQDC5qo/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-05-07 02:10:59'),
