	(282, 282, '2022-08-15 15:08:37', '2022-08-15 15:08:37', 'k4g7h2e1nDI', 'Impressora 3D caseira barateza.', 'Pessoas, \nDecidi não deixar os materiais que usei até porque ela não tá pronta ainda.\n\nMinha mão direita é zuada mesmo, não liguem não.\n\nEsse projeto tem o intuito de ser barato, apenas isso. Desenvolvi do zero a impressora, algumas ideias como a barra rosqueada e os trilhos de gaveta eu vi nos vídeos do canal do marlon nardi, mas em geral é um projeto desenvolvido por mim.\n\nÉ muito entusiasmante você ver uma coisa feita por você funcionar.', '00:00:00', 'k4g7h2e1nDI', 'video/youtube', 'https://i.ytimg.com/vi/k4g7h2e1nDI/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-06-18 06:12:50'),
	(283, 283, '2022-08-15 15:08:37', '2022-08-15 15:08:37', 'nlP_vYNgWpQ', 'Impressão 3D MAIS DETALHADA com um bico de menor diâmetro', '✅ Quer se tornar um profissional da Impressão 3D?\nCurso Online Impressão 3D Total - INSCREVA-SE:\n▶ http://vip.aprendaimpressao3d.com/curso-inscricao\n\nComo um simples bico (nozzle) de impressão 3D que custa aproximadamente R$ 15,00, pode deixar suas impressões 3D ainda mais detalhadas? É que eu vou mostrar nesse vídeo para você. As dicas e técnicas que eu uso para imprimir peças pequenas e com mais detalhes. Não é um processo tão fácil, mas com o vídeo, tudo vai ficar mais claro. Vem e assiste até o fim!!!\n\n💡 E-BOOK GRÁTIS: Como começar na Impressão 3D\n▶ Baixe agora! http://vip.aprendaimpressao3d.com/ebook\n\n🔥 Como trabalhar com Velocidade, Temperatura e Resolução na Impressão 3D?\n▶ https://www.youtube.com/watch?v=E2Fycxpgx7c\n\n🔥 Como imprimir 3D Peças Pequenas com qualidade?\n▶ https://www.youtube.com/watch?v=ISAy3Dz3MqE\n\n👍 Siga a 3D Print Academy nas nossas redes sociais:\n▶ Facebook: https://www.facebook.com/3dprintacademy\n▶ Instagram: http://instagram.com/3dprintacademy\n\n#3DPrintAcademy #Impressão3D #Impressora3D', '00:00:00', 'nlP_vYNgWpQ', 'video/youtube', 'https://i.ytimg.com/vi/nlP_vYNgWpQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UC8nhvBNtxW3xy68aKJnCFGQ', '2019-08-24 05:16:11'),
