	(290, 290, '2022-10-10 14:29:52', '2022-10-10 14:29:52', '1bdAQl8HPLA', 'Impressora 3D caseira #5 - Estrutura principal', 'Mais vídeos e downloads: http://hardware.rbtech.info/impressora-3d-caseira-worklog-dicas/\nNesse vídeo vou mostrar como fiz a montagem da estrutura principal da impressora, ou seja, a base e o arco de sustentação do eixo Z (vertical) da impressora.\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', '1bdAQl8HPLA', 'video/youtube', 'https://i.ytimg.com/vi/1bdAQl8HPLA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:03:58'),
