	(293, 293, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'o9PBMRxQw90', 'Impressora 3D caseira #8 - Eixo X', 'Veja como eu fiz a montagem do eixo X da impressora 3D caseira. Mais vídeos em http://hardware.rbtech.info/impressora-3d-caseira-worklog-dicas/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'o9PBMRxQw90', 'video/youtube', 'https://i.ytimg.com/vi/o9PBMRxQw90/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:16'),
	(294, 294, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'IriiPDqCLF0', 'Impressora 3D caseira #9 - Finalizando a montagem', 'Parte final da montagem estrutural e eletrônica da impressora. A partir de agora entra a parte de configuração e calibração para acertar os detalhes essenciais para começar imprimir.\nMais vídeos em http://hardware.rbtech.info/impressora-3d-caseira-worklog-dicas/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'IriiPDqCLF0', 'video/youtube', 'https://i.ytimg.com/vi/IriiPDqCLF0/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:21'),
	(295, 295, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'MfOWQIDE0Uw', 'Impressora 3D caseira #10 - Configurando o Marlin', 'Chegou a hora de iniciar uma nova etapa no projeto da impressora 3D caseira, a configuração e calibração. Nesse vídeo vou mostrar as configurações iniciais que eu usei no meu projeto e explicar como calcular os steps de cada eixo da impressora.\nMais conteúdo no site http://hardware.rbtech.info/impressora-3d-caseira-configuracao-calibracao/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'MfOWQIDE0Uw', 'video/youtube', 'https://i.ytimg.com/vi/MfOWQIDE0Uw/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:26'),
	(296, 296, '2022-10-10 14:29:52', '2022-10-10 14:29:52', '_nBYw5JROwA', 'Impressora 3D caseira #11 - Calibração básica', 'Nesse vídeo vou mostrar a primeira etapa do processo de calibração da impressora 3D caseira, ou seja, como fazer a aferição das taxas de movimento de cada eixo e ajustar caso necessário.\nMais conteúdo no site http://hardware.rbtech.info/impressora-3d-caseira-configuracao-calibracao/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', '_nBYw5JROwA', 'video/youtube', 'https://i.ytimg.com/vi/_nBYw5JROwA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:30'),
	(297, 297, '2022-10-10 14:29:52', '2022-10-10 14:29:52', '6OBLGEKCrvA', 'Impressora 3D caseira #12 - Imprimindo a primeira peça', 'Veja nesse vídeo com fazer a calibração da sua impressora 3d imprimindo um cubo de verificação para acertar sua máquina e deixá-la com a precisão ideal. Além de preparar a peça você vai aprender como nivelar a mesa para começar a imprimir.\nMais conteúdo no site http://hardware.rbtech.info/impressora-3d-caseira-configuracao-calibracao/\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', '6OBLGEKCrvA', 'video/youtube', 'https://i.ytimg.com/vi/6OBLGEKCrvA/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:34'),
	(298, 298, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'n7dqQu8SewQ', 'Impressora 3D caseira #13 - Dúvidas comuns (FAQ)', 'Confira nesse vídeo as respostas para as principais dúvidas deixadas na série sobre a impressora 3D caseira.\n=== ÍNDICE DO CONTEÚDO ===\n4:01 O que fazer/estudar para ajudar na construção de uma impressora?\n5:21 Qual software usado na impressora? É livre? Multiplataforma?\n5:52 Tem um manual em PDF para seguir?\n6:14 Dá pra usar outros motores? Motores diferentes?\n6:59 Por que meus motores estão travando?\n8:00 Por que meu LCD não funciona?\n8:48 Dá pra fazer com área de impressão maior?\n9:35 Corrediças são precisas pra uma impressora 3D?\n10:53 Posso usar outro tipo de vidro na mesa aquecida?\n12:05 Quanta energia a impressora gasta?\n13:20 Preciso saber modelar 3D? Onde baixar peças pra imprimir?\n14:36 Demora pra imprimir uma peça?\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'n7dqQu8SewQ', 'video/youtube', 'https://i.ytimg.com/vi/n7dqQu8SewQ/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:39'),
	(299, 299, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'AvRw_uOG0zg', 'Impressora 3D caseira #14 - Upgrades e modelagem', 'Links e conteúdo extra: http://hardware.rbtech.info/impressora-3d-caseira-upgrades-melhorias/\nConfira os upgrades/melhorias feitas na impressora 3D caseira e conheça também o Tinkercad, uma ferramenta básica de modelagem para criar suas primeiras peças autorais.\n\nAcompanhe o RBtech: http://rbtech.info/siga/', '00:00:00', 'AvRw_uOG0zg', 'video/youtube', 'https://i.ytimg.com/vi/AvRw_uOG0zg/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCydnENu8reGSdzfBjW0bfDw', '2021-06-16 11:04:46'),
