	(302, 302, '2022-10-10 14:29:52', '2022-10-10 14:29:52', 'BTUVGvbJbc8', '3D Printer | Homemade - Part 3', 'Arduino 3D Printer | Homemade - Part 3\nIn the third part of Homemade 3D Printer, I completed connecting all  3D Printer electronics to the main RAMPS 1.4 Board and Upload the Marlin code the Arduino Mega.This video also shows how to generate G-Code and send it to your 3D Printer with Slic3r and Pronterface Softwares.I printed a 20mm Test cube, which came out to be a good print.I also modified some parts of the 3D Printer, like the x-carriage, z-axis and added a cooling fan.This was the last video for this project, I Hope you enjoyed the Video!\n\nInstagram-https://www.instagram.com/shinedjar/\nFacebook-https://www.facebook.com/RZtronics/\nTwitter - https://twitter.com/RZtronix\n\nArduino Code, Software and Schematics-\nhttp://rztronics.com/arduino-3d-printer-code-software-and-schematics/\n\nParts Used:\n\nAliexpress\n\nArduino Mega+RAMPS 1.4 Shield+4 x A49AA Stepper Driver-http://s.click.aliexpress.com/e/eMvbYVn\n5 x NEMA 17 Stepper Motor-\nhttp://s.click.aliexpress.com/e/ZJAaa6Y\nE3D Hotend-\nhttp://s.click.aliexpress.com/e/bAIYJeA\n3 x Endstops-\nhttp://s.click.aliexpress.com/e/RFQfImu\nLCD Display(optional)-\nhttp://s.click.aliexpress.com/e/vJyRjyF\nHeat Bed-\nhttp://s.click.aliexpress.com/e/bmMz37I\n240 watt Power supply-\nhttp://s.click.aliexpress.com/e/fA2vBYN\nPLA Filament (1KG)-\nhttp://s.click.aliexpress.com/e/eqFu3Jm\nOR\nPLA Filament (Different Colours)-\nhttp://s.click.aliexpress.com/e/zFAMVJU\nMK8 Extruder-\nhttp://s.click.aliexpress.com/e/QBeeEAM\nGT2 Timing Belt+2 x GT2 Pulley-\nhttp://s.click.aliexpress.com/e/auneAmy\nSC8UU Bearings(Replacement for LM8UU Bearings)-\nhttp://s.click.aliexpress.com/e/VFUZjA6\n5x8mm Couplers-\nhttp://s.click.aliexpress.com/e/EAEa2bI\n8mm Smooth Rods-\nhttp://s.click.aliexpress.com/e/YNj6Eqf\nSmooth Rod Holder-\nhttp://s.click.aliexpress.com/e/MZbmqFm\nstepper Motor Mount-\nhttp://s.click.aliexpress.com/e/zZbiYZ7\nThreaded Rod-\nhttp://s.click.aliexpress.com/e/AQ7yBYn\nAngle Brackets-\nhttp://s.click.aliexpress.com/e/fYn6Mrn\nM3 Screws-\nhttp://s.click.aliexpress.com/e/nmMrBE6\nM3 Nuts-\nhttp://s.click.aliexpress.com/e/ZrnuNzZ\n3mm Acrylic sheet\nAluminum Channel for Frame\n\nAmazon\n\nNema 17 Stepper motor-http://amzn.to/2F2v8Zy\nRamps 1.4 + A4988 + Arduino Mega-http://amzn.to/2F4FckO\nEndstops-http://amzn.to/2CvRZee\nE3D Hotend-http://amzn.to/2m3zJCa\n240watt Power Supply-http://amzn.to/2lYZa7E\nLCD Display(optional)-http://amzn.to/2CI8V4K\nMK8 Extruder-http://amzn.to/2AALVzy\nHeatBed-http://amzn.to/2lYT33r\nPLA Filament-http://amzn.to/2Cz1JEu\nPLA Filament (Different Colours)-http://amzn.to/2CxRSik\n2 x 5mmx8mm Couplers-http://amzn.to/2CvADhv\nGT2 Timing Belt-http://amzn.to/2CJWZiN\n2 x Lead Screw + Flange Nut -http://amzn.to/2CvVh15\nSmooth Rods-http://amzn.to/2F4fjBC\nSmooth Rod Holder-http://amzn.to/2F0X6oq\nStepper Motor Mount-http://amzn.to/2CIfgNj\nSC8UU Bearings(Replacement for LM8UU Bearings)-http://amzn.to/2CxhtrP\nAngle Brackets-http://amzn.to/2Cza0IR\nM3 Screws-http://amzn.to/2Ay5Z5u\nM3 Nuts-http://amzn.to/2qzcjK8\n3mm Acrylic sheet\nAluminum Channel for Frame\n\nEbay\n\nArduino Mega+RAMPS 1.4 Shield+4 x A49AA Stepper Driver-\nhttps://goo.gl/wNjjNM\n5 x NEMA 17 Stepper Motor-\nhttps://goo.gl/w1wHQc\nE3D Hotend-\nhttps://goo.gl/MiBY7w\n3 x Endstops-\nhttps://goo.gl/mSBG3T\nHeat Bed-\nhttps://goo.gl/ZmBBji\n240 watt Power supply-\nhttps://goo.gl/EMvCUN\nPLA Filament (1KG)-\nhttps://goo.gl/zPGu8V\nABS Filament -\nhttps://goo.gl/TbqsmV\nMK8 Extruder-\nhttps://goo.gl/nZJ7ow\nGT2 Timing Belt+2 x GT2 Pulley-\nhttps://goo.gl/gioi6x\nLM8UU-\nhttps://goo.gl/rbU4af\nSC8UU Bearings(Replacement for LM8UU Bearings)-\nhttps://goo.gl/itw6Cv\n5x8mm Couplers-\nhttps://goo.gl/p8RjAh\n8mm Smooth Rods-\nhttps://goo.gl/oXKr1k\nSmooth Rod Holder-\nhttps://goo.gl/r4zoPL\nstepper Motor Mount-\nhttps://goo.gl/5Tphwz\nThreaded Rod-\nhttps://goo.gl/YcJV1W\nAngle Brackets-\nhttps://goo.gl/