	(420, 420, '2022-10-18 00:37:40', '2022-10-18 00:37:40', 'mHbeEi8wkKY', 'Como criar e se conectar a uma instância EC2 Linux, do tipo Ubuntu na AWS gratuitamente.', 'Nesse vídeo, mostraremos de forma prática como:\n- Criar uma instância EC2 Linux na AWS\n- Como se conectar a ela via SSH\n- Como gerar e trabalhar com a chave pem\n- Uso correto do Security Group para conceder acesso\n\nAproveite e inscreva-se em nosso curso grátis: Migrando sua aplicação para a AWS do zero absoluto.\nhttps://pages.formacaoaws.com.br/inscricao-migrando-app-nuvem-v2/\n\nParticipe também da nossa comunidade de Devs na Cloud no Telegram:\nhttps://t.me/devsnacloud', '00:00:00', 'mHbeEi8wkKY', 'video/youtube', 'https://i.ytimg.com/vi/mHbeEi8wkKY/mqdefault.jpg', '(min-width: 400px;)', 'image/jpeg', 'UCYihfm2hMVxsiDSk_o0lcow', '2022-10-17 11:56:16'),
